import React from 'react'
import cssTopics from './CssCourseData'
import Navbar from '../HomePage/Navbar/Navbar'
const CssCourse = () => {
    return (
        <div>
            <>
                <Navbar />
                {
                    cssTopics.map((item, key) => (
                        <div className='mainDivLanding row'>
                            <div className="col-12">
                                <p id='div1Text'>{item.topic_name}</p>
                                <h4 style={{ marginLeft: "6%" }}>{item.topic_description}</h4>
                            </div>

                            <p  style={{ fontFamily: 'Josefin Sans', padding: "6%", paddingTop: "1%" }}>
                                {
                                    item.subtopics.map((item2, key) => (
                                        <>
                                            <h4 key={key} style={{ marginLeft: "18%" }}>{item2.subtopic_name}</h4>
                                            <p style={{ marginLeft: "24%", backgroundColor: "whitesmoke", color: "rgb(110, 110, 110)", width: "100%", padding: "3%", fontSize:""}}>{item2.example_code}</p>

                                        </>
                                    ))
                                }
                            </p >
                        </div >
                    ))
                }
            </>
        </div>
    )
}

export default CssCourse
